'''Doge'''是一个在2013年底迅速传播的网络[[meme]]，本条目同时收录'''Doge'''的娘化形象。

== 起源 ==
该meme最典型的形象是一张关于日本柴犬的照片，在这张照片上，一只日本柴犬双{{Ruby|前爪|<s>手</s>}}卧在沙发上，并侧脸斜眼看着主人的镜头。

在很多流传的版本中图片上都会有以Comic Sans字体显示的各种蹩脚英语，譬如「Wow」、「Such xxx」、「Many xxx」、「So xxx」、「Very xxx」。

照片中柴犬本名叫Kabosu（{{lang-ja|かぼす}}）是一只雌性日本柴犬，原照片最早是2010年它的主人Atsuko Sato发在博客上的<ref>[http://kabosu112.exblog.jp/9944144/ 万恶之源]</ref>。后来出现在Tumblr的“Shiba Confessions”博客中，而作为一个meme风靡于网络则是从2013年八月的4chan /b/版开始。

{{黑幕|由于报导上出现了偏差，很多人以为它已经去世，实际上在2017年2月16日去世的那只柴犬名叫[https://ja.wikipedia.org/wiki/DASH村#家畜 北登]}}

