== 影响 ==
由于其独特的{{黑幕|逗比}}气质，以及<del>无孔不入的</del>图片，常被称作“神烦狗”。

* 新浪微博上的Doge表情。
* 2013年Google复活节彩蛋：在Youtube上搜索“doge meme”，搜索结果页面的文字会变成彩色的Comic Sans字体<ref>[http://googlesystem.blogspot.com/2013/11/youtube-easter-egg-for-doge-meme.html 2013年Google复活节彩蛋]</ref>。
* 2016年播出的中国动画片《[[前方高能之神烦狗]]》。

